import Card from "./card";

function Grid(props) {
  const position = {
    container:
      "grid grid-cols-2 md:grid-cols-3 lg:grid-cols-4 xl:grid-cols-5 2xl:grid-cols-6 gap-4 px-4",
  };

  return (
    <div className={position.container}>
      {props.products &&
        props.products.map((product) => <Card product={product} />)}
    </div>
  );
}

export default Grid;
